import React from 'react';
import './App.css';
import HomepageImage from './components/HomepageImage';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <HomepageImage />
        <p>
          My website
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Charlie Leopard
        </a>

      </header>
    </div>
  );
}

export default App;
